import ThemeContext from '../../context/theme';
import { Section, Card } from '../Globals';

import { newGames as layout } from '../../config/layout';

class NewGames extends React.Component {
  static contextType = ThemeContext;

  render() {
    return (
      <div
        style={{ border: '1px solid red', width: '500px', overflow: 'hidden' }}
      >
        <Section style={{ overflow: 'scroll' }} {...layout}>
          <Section>
            <Card
              style={{
                height: '100px',
                width: '100px',
                borderRadius: '50%',
                margin: '10px'
              }}
            >
              1
            </Card>
          </Section>
          <Section>
            <Card
              style={{
                height: '100px',
                width: '100px',
                borderRadius: '50%',
                margin: '10px'
              }}
            >
              2
            </Card>
          </Section>
          <Section>
            <Card
              style={{
                height: '100px',
                width: '100px',
                borderRadius: '50%',
                margin: '10px'
              }}
            >
              3
            </Card>
          </Section>
          <Section>
            <Card
              style={{
                height: '100px',
                width: '100px',
                borderRadius: '50%',
                margin: '10px'
              }}
            >
              4
            </Card>
          </Section>
          <Section>
            <Card
              style={{
                height: '100px',
                width: '100px',
                borderRadius: '50%',
                margin: '10px'
              }}
            >
              5
            </Card>
          </Section>
          <Section>
            <Card
              style={{
                height: '100px',
                width: '100px',
                borderRadius: '50%',
                margin: '10px'
              }}
            >
              6
            </Card>
          </Section>
          <Section>
            <Card
              style={{
                height: '100px',
                width: '100px',
                borderRadius: '50%',
                margin: '10px'
              }}
            >
              7
            </Card>
          </Section>
          <Section>
            <Card
              style={{
                height: '100px',
                width: '100px',
                borderRadius: '50%',
                margin: '10px'
              }}
            >
              8
            </Card>
          </Section>
        </Section>
      </div>
    );
  }
}

export default NewGames;
